INSERT INTO `m_disease` VALUES ('10015', '', '{\"en-US\":\"Lung Carcinoma\",\"ja-JP\":\"\",\"ko-KR\":\"\"}', 'Lung cancer is one of the most rapidly increasing morbidity and mortality, and one of the most serious malignancies in population health and life.', '8', '2017-12-14 09:02:40', '20171101060001', '2018-07-02 06:03:11', '20171101010010', '0');
