INSERT INTO `m_disease` VALUES ('10018', '', '{\"en-US\":\"Gastric Carcinoma\",\"ja-JP\":\"\",\"ko-KR\":\"\"}', 'Gastric cancer refers to the tumor of the epithelial cells, which is formed in the stomach. The early symptoms of gastric cancer are the hindrance after eating, pain and vomiting after eating, and a few patients have hematemesis, black and other symptoms.', '8', '2017-12-14 10:04:24', '20171101060001', '2018-04-20 08:54:15', '20171101010010', '1');
