INSERT INTO `m_disease` VALUES ('10022', 'Nasopharyngeal Carcinoma', null, 'Nasopharyngeal cancer  is a malignant tumor occurring at the top and side of the nasopharyngeal cavity. ', '9', '2017-12-14 15:38:14', '20171101060001', '2018-03-19 16:42:59', '20171101010010', '1');
INSERT INTO `m_disease` VALUES ('10023', '', '{\"en-US\":\"Liver Carcinoma\",\"ja-JP\":\"\",\"ko-KR\":\"\"}', 'The liver is the detoxifying organ of our body. The incidence of liver cancer is more subtle and aggressive. The early stage is not easy to detect, and the later growth is rapid, which endangers people\'s life. ', '7', '2017-12-14 15:43:11', '20171101060001', '2018-07-02 06:03:11', '20171101010010', '0');
INSERT INTO `m_disease` VALUES ('10024', '', '{\"en-US\":\"Esophageal Carcinoma\",\"ja-JP\":\"\",\"ko-KR\":\"\"}', 'Esophageal cancer is high-incidence in China, which is often found in middle age. It is found that there are many factors of esophageal cancer, such as deficiency of vitamins, trace elements, irregular diet, heredity and exposure to chemical substances.', '6', '2017-12-14 15:43:49', '20171101060001', '2018-07-02 06:03:11', '20171101010010', '0');
INSERT INTO `m_disease` VALUES ('10025', '', '{\"en-US\":\"Cervical Carcinoma\",\"ja-JP\":\"\",\"ko-KR\":\"\"}', 'Cervical carcinoma  has decreased in recent years. Smoking, viral infections and bad habits are all factors that contribute to cervical cancer.', '5', '2017-12-14 15:44:08', '20171101060001', '2018-07-02 06:03:11', '20171101010010', '0');
INSERT INTO `m_disease` VALUES ('10026', 'Breast Carcinoma', null, 'Breast cancer is a common tumor in  female, which threats female\'s life and health. In general, symptoms are more obvious. It is recommended that the majority of women should go to the hospital regularly to check for the reduction of breast cancer, early detection and early treatment.', '5', '2017-12-14 15:44:31', '20171101060001', '2018-03-19 16:47:37', '20171101010010', '1');
INSERT INTO `m_disease` VALUES ('10027', 'Colorectal Carcinoma', null, 'Colorectal cancer is common in gastrointestinal tractEarly symptoms are not obvious. ', '4', '2017-12-14 15:46:23', '20171101060001', '2018-03-19 16:51:37', '20171101010010', '1');
INSERT INTO `m_disease` VALUES ('10028', 'Melanoma', '{\"en-US\":\"Melanoma\",\"ja-JP\":\"\",\"ko-KR\":\"\"}', 'It\'s a kind of malignant tumor that comes from melanocytes. It is common in the skin, also in the mucosa, the eye choroid and other parts.', '3', '2017-12-18 09:53:14', '20171101060001', '2018-03-14 09:56:20', '20171101010010', '1');
