INSERT INTO `m_string` VALUES ('253', 'Steven R. AlbertsAlbertsAlbertsAlbertsGI', '{\"zh-CN\":\"\",\"en-US\":\"Steven R. Alberts is a professor of oncology at the Mayo Clinic School of Medicine and a consultant to the Medical Oncology Department. He is also the Medical Director of the Clinical Research Unit at the Mayo Clinic Cancer Center and co-chair of the Pancreatic Cancer Subcommittee of the Cancer Clinical Trials Alliance. Dr. Alberts has a long career in research before medical oncology. He holds a master\'s degree in public health and has worked as an epidemiologist at the Indian Health Authority and the Centers for Disease Control and Prevention. In his previous position, Dr. Alberts participated in the Alaska Aboriginal Cancer Research. Dr. Alberts is also a member of the National Cancer Institute-funded GI Steering Committee, the Pancreatic Cancer Task Force and the Colorectal Cancer Task Force.\",\"ja-JP\":\"\",\"th-TH\":\"\"}', '2018-07-02 03:10:22', '2018-07-03 07:56:37');
