INSERT INTO `m_user` VALUES ('20180702020002', 'Hugh Jackman', '{\"zh-CN\":\"\",\"en-US\":\"Hugh Jackman\",\"ja-JP\":\"\",\"th-TH\":\"\"}', '32', '17ce0fcf7ab6cb367742a5565e44fc2d91857f2e', '2', null, 'sizukacheung@sina.com', '+16267807555', null, null, null, 'Hans Schoellhammer, a melanoma expert and surgical oncologist, said that his work was particularly satisfying to him. He said: \"By working with people, patients can be treated and have a direct and significant impact on their health.\"', 'Medical doctor, clinical assistant professor of tumor surgery, surgeon', 'Oncology', '2000.00', 'usd', null, 'attach/2018/07/_bcac287c7b05fca9a56c87e7877dfbeb432614d4:.jpg:15.97KB', null, null, '0', null, '2018-07-23 00:59:59', '2018-07-02 02:06:54', '20171202050001', '2018-07-23 00:59:59', null, '0');
INSERT INTO `m_user` VALUES ('20180702020003', 'MIHAELA C. CRISTEA', null, '32', '17ce0fcf7ab6cb367742a5565e44fc2d91857f2e', '2', null, 'sizukacheung@sina.com', '+12115523333', null, null, null, 'Medical Doctor Mihaela Cristea is a medical oncologist with expertise in the treatment of lung cancer and gynaecological cancer. Her research and clinical work focuses on finding better drugs to treat these cancers, and through a gentle treatment to improve the quality of life of patients throughout the treatment.', 'Associate Professor of Clinical Oncology and Therapeutics, Department of Medicine, Iasi Medical and Pharmaceutical University, Romania, Medical Oncologist', 'Oncology', null, null, null, 'attach/2018/07/_7de7fd2a063b2d059cffec7b203fba06c03d2315:.jpg:172.39KB', null, null, '0', null, '2018-07-04 05:55:33', '2018-07-04 05:54:39', '20171202050001', '2018-07-04 05:55:33', null, '0');
