INSERT INTO `m_user` VALUES ('20180746020001', 'Alice', null, '32', '17ce0fcf7ab6cb367742a5565e44fc2d91857f2e', '2', null, '856322214@qq.com', '+16255559999', null, null, null, 'Medical Doctor Mihaela Cristea is a medical oncologist with expertise in the treatment of lung cancer and gynaecological cancer. Her research and clinical work focuses on finding better drugs to treat these cancers, and through a gentle treatment to improve the quality of life of patients throughout the treatment.\nDr. Cristea was involved in the study of how to detect specific proteins in the blood and urine that indicate the presence of lung cancer, potentially reducing the need for biopsy. She is also a ', 'Associate Professor of Clinical Oncology and Therapeutics, Department of Medicine, Iasi Medical and Pharmaceutical University, Romania, Medical Oncologist', 'Oncology', null, null, null, 'attach/2018/07/_0c966c9626b5eb0aa69db925c374e09cf96fa49a:.jpg:172.39KB', null, null, '0', null, null, '2018-07-04 05:39:39', '20171101010010', '2018-07-04 05:40:09', '20171101010010', '0');
